import React from "react";
import Grid from "@material-ui/core/Grid";
import Button from "@material-ui/core/Button";
import './index.css'

const GoogleButton = ({ type }) => {
    return (
        <Grid item>
            <Button style={{ backgroundColor: "white" }} className = "google-btn">
                <div className="google-icon-wrapper">
                    <img className="google-icon" src="https://upload.wikimedia.org/wikipedia/commons/5/53/Google_%22G%22_Logo.svg" alt="Google"/>
                </div>
                <p className="btn-text">
                    <b>
                        {type ? "Login with Google" : "Sign up with Google"}
                    </b>
                </p>
            </Button>
        </Grid>
    );
}

export default GoogleButton;
